//High Priority Daemon Monitor - Used with the report to check for P1 or P2 cases/requests 
//this script will make the background of the report flash red and blue when a high priority comes in and plays an annoying siren sound 
//alternate between colours
var flashStep = 1;
//colours
var colours = ["WHITE","RED","BLUE"];
//flash every half second
var flashInterval = 500;
//total flashes since last refresh
var flashCount = 0;
//refresh every 5 minutes, 300 seconds
var LongInterval = 300000;
var ShortInterval = 10000;
var RefreshInterval = LongInterval;
//total time since last refresh
var TimeSinceLastRefresh = 0;
//play sound 
var playsound = 1;
//refresh sooner when high priority case is flash
var HighPriority = false;

window.setInterval(function(){
    //make sure this is the right dashboard
    if (window.location.href == "https://cdkglobal.my.salesforce.com/01Z0J00000122Ax") {
        //make double sure this is the right dashboard
        if (document.title == "Dashboard: EBL - High Priorities Requests/Cases ~ Salesforce - Unlimited Edition") {
            //do special check here
            var el = document.querySelector("div.cContent map area");
            if (el !== null) {
                HighPriority = true;
                if(flashStep != 1) {
                    $('.dashboardViewPageBody').css('background-color', colours[flashStep]);
                    flashStep=1;
                } else {
                    $('.dashboardViewPageBody').css('background-color', colours[flashStep]);
                    flashStep=2;
                }
                //play sound alternatively, can be shoved up there ^
                if (flashStep % 2 == 1) {
                    playtone();
                }
            } else {
                HighPriority = false;
                $('.dashboardViewPageBody').css('background-color', colours[0]);
            }
            if (HighPriority === true) {
                RefreshInterval = ShortInterval;
            } else {
                RefreshInterval = LongInterval;
            }
            //document should have flashed increment the counter
            flashCount++;
            //multiple count by seconds per flash to get total time since last refresh
            TimeSinceLastRefresh = flashCount * flashInterval;
            //if the time elapsed is more or equal to our limit then refresh
            if (TimeSinceLastRefresh >= RefreshInterval) {
                //reset the flash count
                flashCount = 0;
                //refresh the dashboard
                sfdc.dashboardView.doRefresh(false);
             }
        }
    }
}, flashInterval);

var playtone = function(){
    var snd = new Audio("data:audio/x-wav;base64, ");
    snd.play();
    playsound = 0;
}
